import Head from 'next/head';
import Navbar from './NavBar';

const Layout = (props) => (
    <div className="bg-local" style="background-image: url('https://images.pexels.com/photos/110854/pexels-photo-110854.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940')">
        <Head>
            <title>SpaceX</title>
        </Head>
        <Navbar />
        {props.children}
    </div>
);

export default Layout;
